INSERT INTO `actas_comite` (`acta_id`, `acta_fecha`, `acta_tipo`, `acta_asistentes`, `acta_presidente`, `acta_secretaria`, `acta_cabecera`, `acta_cuerpo`, `acta_consecutivo`) VALUES
(2, '2019-08-07', '3', '1,2,', '3', '2', '<p>En la ciudad de Bogot&aacute; D.C., a los veinticinco (25) d&iacute;as del mes de abril del a&ntilde;o dos mil diecinueve (2019), se reunieron <strong>ORDINARIAMENTE</strong> y de conformidad con lo establecido por el Reglamento del Comit&eacute; de Cr&eacute;dito y Especial de Cr&eacute;dito en el Par&aacute;grafo del Art&iacute;culo 6, los siguientes miembros del <strong>COMIT&Eacute; ORDINARIO DE CR&Eacute;DITO</strong> del Fondo de Empleados Grupo Endesa Colombia- <strong>FENDESA</strong>:</p>', '<p>As&iacute; mismo, asiste la se&ntilde;ora <strong>CAROLINA CARRE&Ntilde;O LARGO</strong>, en calidad de T&eacute;cnico Cr&eacute;dito y Cartera de FENDESA. En dicha Sesi&oacute;n, se desarroll&oacute; el siguiente orden del d&iacute;a:<br /><br /><strong>1. VERIFICACI&Oacute;N DEL QU&Oacute;RUM.</strong><br /><br />La se&ntilde;ora <strong>CAROLINA CARRE&Ntilde;O LARGO</strong>, en calidad de T&eacute;cnico Cr&eacute;dito y Cartera, verifica la asistencia a la reuni&oacute;n, encontrando la participaci&oacute;n de tres (3) miembros del Comit&eacute;, lo cual constituye qu&oacute;rum para deliberar y adoptar decisiones v&aacute;lidas.<br /><br /><strong>2. PRESENTACI&Oacute;N SOLICITUDES DE CREDITO ASOCIADOS PARA APROBACI&Oacute;N Y DESEMBOLSO.</strong><br /><br />La se&ntilde;ora <strong>CAROLINA CARRE&Ntilde;O LARGO</strong>, en calidad de T&eacute;cnico Cr&eacute;dito y Cartera de <strong>FENDESA</strong> y secretario del Comit&eacute; Ordinario de Cr&eacute;dito, presenta la relaci&oacute;n de solicitudes de cr&eacute;dito radicadas por los asociados y evaluadas, las cuales se detallan en el Anexo # 1 parte integral de la presente Acta.<br /><br /><strong>3. MONTO TOTAL APROBADO.</strong><br /><br />Una vez revisada y analizada la informaci&oacute;n contenida en el Anexo # 1 de la presente Acta por los miembros del Comit&eacute; Ordinario de Cr&eacute;dito, al tenor de lo dispuesto por la Circular B&aacute;sica Contable y Financiera y el Reglamento de Ahorro y Cr&eacute;dito vigente de <strong>FENDESA</strong>, el monto total <strong>APROBADO</strong> es por la suma de <strong>CATORCE MILLONES CIENTO SETENTA MIL PESOS M/CTE ($ 14.170.000)</strong>.<br /><br /><strong>4. DESEMBOLSO, NOTIFICACIONES Y ENVIO DE TABLAS DE AMORTIZACI&Oacute;N.</strong><br /><br />Los miembros del comit&eacute; Ordinario de Cr&eacute;dito de <strong>FENDESA</strong> solicitan a la se&ntilde;ora <strong>CAROLINA CARRE&Ntilde;O LARGO</strong>, en calidad de T&eacute;cnico Cr&eacute;dito y Cartera <strong>FENDESA</strong>: Adelantar las acciones pertinentes tendientes al desembolso de las solicitudes de Cr&eacute;dito de acuerdo la informaci&oacute;n contenida en el anexo N&deg;1 de la presente Acta y en observancia a lo consagrado por el Articulo 44 Par&aacute;grafo 1 y 2 del Reglamento de Ahorro y Cr&eacute;dito vigente de <strong>FENDESA</strong>;</p>\r\n<ul>\r\n<li>Notificar por correo electr&oacute;nico, llamada telef&oacute;nica o comunicaci&oacute;n a trav&eacute;s de documento por escrito al asociado identificado con el Anexo N&deg;1 de la presente Acta en relaci&oacute;n con la aprobaci&oacute;n y desembolso de la solicitud de Cr&eacute;dito, informando en detalle las condiciones de aprobaci&oacute;n.</li>\r\n<li>Enviar por correo electr&oacute;nico o comunicaci&oacute;n a trav&eacute;s de documento por escrito a cada uno de los Asociados indicados en el Anexo N&deg;1 de la presente Acta, la tabla de amortizaci&oacute;n de la solicitud de Cr&eacute;dito respectiva.</li>\r\n<li>A los asociados que tienen reporte negativo en la central de riesgo, avisarles de la mora, y a aquellos que tienen cartera castigada girar directamente a las entidades de lo reportaron y solicitar una vez pagado los respectivos paz y salvos.</li>\r\n</ul>\r\n<p><strong>5. PROPOSICIONES Y VARIOS.</strong> Se encuentra aprobado por el comit&eacute; de cr&eacute;dito y se realizara su causaci&oacute;n y desembolso cuando se cumplan todas las condiciones de acuerdo con el reglamento de cr&eacute;dito. <br /><br /></p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td><strong>LUIS MIGUEL RUEDA SILVA</strong></td>\r\n<td><strong>CAROLINA CARRE&Ntilde;O LARGO</strong></td>\r\n</tr>\r\n<tr>\r\n<td><strong>Presidente</strong></td>\r\n<td><strong>Secretaria</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>', '1'),
