(1, 1, 1, '2018-10-25', 'Bienvenido a nuestra pagina', '', '', '<h2 style=\"text-align: center;\">Bienvenido a nuestra pagina</h2>\r\n<p style=\"text-align: center;\">Lorem Ipsum&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '', '', '', '', 0, '', 1),
(2, 1, 1, '2018-10-25', 'Bienvenido a nuestra pagina', '', '', '<h2 style=\"text-align: center;\"><span style=\"color: #ffffff;\">otro texto de bienvenida que va a salir en el home</span></h2>', '', '#FF0000', '', '', 0, '', 2);
INSERT INTO `content` (`content_id`, `content_state`, `content_title`, `content_subtitle`, `content_introduction`, `content_description`, `content_image`, `content_banner`, `content_banner_responsive`, `content_section`, `content_columnas`, `content_fondo`, `content_vermas`, `content_padre`, `orden`, `content_delete`, `content_current_user`, `content_date`, `content_link`) VALUES
(3, NULL, 'Bienvenido a nuestro Fondo', '', '', '<p style=\"text-align: center;\">Para que puedas alcanzar tus metas y disfrutar de cada momento, nuestro compromiso es <br />brindarte alternativas de ahorro, cr&eacute;dito y beneficios.</p>', '', '', NULL, 'Bienvenida', 0, 0, 0, 0, 35, 0, 0, '2018-03-14', ''),
(4, 0, 'Ahorro', '', '', '<p>Tu futuro es tu bienestar, comienza a construirlo con Fendesa.</p>', 'azul-1_1.png', 'imagen_home_ahorro-01.jpg', '', 'Boton Home', 0, 0, 2, 0, 36, 0, 0, '2018-03-14', '/page/servicios/detalle/13/ahorro'),
(5, 0, 'Cr&eacute;dito', '', '', '<p>No olvides tus sue&ntilde;os, alc&aacute;nzalos con nuestros cr&eacute;ditos pensados para ti.</p>', 'amarillo_1.png', 'imagen_home_credito-01.jpg', '', 'Boton Home', 0, 0, 2, 0, 37, 0, 0, '2018-03-14', '/page/servicios/detalle/19/credito'),
(6, 0, 'Alianzas', '', '', '<p>Porque pensamos en ti, unimos fuerzas con las mejores entidades.</p>', 'azul1_1.png', 'imagen_home_alianza-01.jpg', '', 'Boton Home', 0, 0, 0, 0, 38, 0, 0, '2018-03-14', '/page/alianzas'),
(7, 0, 'Servicios en l&iacute;nea', '', '', '<p>Te brindamos las mejores herramientas para tus consultas online.</p>', 'rosado_1.png', 'imagen_home_servicios_en_linea-01.jpg', '', 'Boton Home', 0, 0, 0, 0, 39, 0, 0, '2018-03-14', '/sistema'),
(8, NULL, 'Con&oacute;cenos', '', '', '<p style=\"text-align: center;\"><strong>Para que puedas alcanzar tus metas y disfrutar de cada momento, nuestro compromiso es</strong>&nbsp;<br />brindarte alternativas de ahorro, cr&eacute;dito y beneficios.</p>', '', '', '', 'Introduccion Conocenos', 0, 5, 0, 0, 40, 0, 0, '2018-03-15', ''),
(9, 0, 'Historia', '', '', '<p style=\"text-align: justify;\">FENDESA nace por iniciativa de un grupo de empleados de CODENSA S.A. ESP quienes pretend&iacute;an contar con otras alternativas de ahorro y cr&eacute;dito para obtener beneficios m&aacute;s acordes a las expectativas personales y al mercado financiero. El 3 de diciembre de 2002, se realiza una presentaci&oacute;n a los Gerentes de CODENSA S.A.&nbsp;ESP, con el fin de obtener su aprobaci&oacute;n y aportes.</p>\r\n<p style=\"text-align: justify;\">Despu&eacute;s de analizar diferentes alternativas de empresa solidaria, se toma la decisi&oacute;n de crear un Fondo de Empleados para todos los colaboradores de las empresas en las que participa el Grupo Endesa Colombia. El 3 de abril de 2003 se realiza la Asamblea de Constituci&oacute;n de FENDESA y el 10 de junio del mismo a&ntilde;o, cobra vida jur&iacute;dica con el registro ante la C&aacute;mara de Comercio de Bogot&aacute;, mes mismo en el que se da inicio a la operaci&oacute;n de prestaci&oacute;n de servicios de ahorro y cr&eacute;dito, ajustados a la Ley, Estatutos y Reglamentos. Se inicia operaci&oacute;n con 62&nbsp; asociados h&aacute;biles en el mes de junio de 2003.</p>', '', 'equipo-01.jpg', 'fondo-cafe13.jpg', 'Conocenos', 4, 3, 1, 0, 41, 0, 0, '2018-03-15', ''),
(10, 0, 'Misi&oacute;n y Visi&oacute;n', '', '', '<div class=\"page\" title=\"Page 3\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: right;\"><strong>Misi&oacute;n:</strong> FENDESA es una empresa asociativa del sector de la econom&iacute;a solidaria, de derecho privado, sin &aacute;nimo de lucro, dedicada a la satisfacci&oacute;n de las necesidades de los asociados, sus familias y el entorno social, a partir de la cultura del ahorro como fuente de bienestar y mejoramiento de la calidad de vida.</p>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<p style=\"text-align: right;\"><strong>Visi&oacute;n:</strong> A 2020 ser referente la empresa l&iacute;der en alternativas de ahorro, cr&eacute;dito y beneficios en el sector de econom&iacute;a solidaria social en el pa&iacute;s, para la comunidad del Grupo en Colombia.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 'mision-01.jpg', '', 'Conocenos', 1, 7, 1, 0, 42, 0, 0, '2018-03-15', ''),
(11, NULL, 'Valores', '', '', '', 'imagen-cuadros.png', '', '', 'Conocenos', 6, 4, 1, 0, 43, 0, 0, '2018-03-16', ''),
(12, 0, 'Junta directiva', '', '', '<div class=\"page\" title=\"Page 5\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><img src=\"/upload/Captura%20de%20pantalla%202018-04-05%20a%20la(s)%204.55.41%20a.%20m..png\" alt=\"Captura de pantalla 2018-04-05 a la(s) 4.55.41 a. m.\" /></p>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<p><strong>Junta Directiva Principal&nbsp;</strong></p>\r\n<p>Alex Aldana Mill&aacute;n</p>\r\n<p>Martha Lucia Mahecha</p>\r\n<p>Luis Harley Lima</p>\r\n<p>Pedro Alejandro Romero</p>\r\n<p>Cristian Camilo Castro&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Junta Directiva Suplente&nbsp;</strong></p>\r\n<p>Mar&iacute;a Ang&eacute;lica Buitrago</p>\r\n<p>Soledad Campos</p>\r\n<p>Fred Campo</p>\r\n<p>Julian Alberto Garnica</p>\r\n<p>Carlos Andres Pedraza Pulido&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 'imagen-07.jpg', '', 'Conocenos', 2, 6, 1, 0, 44, 0, 0, '2018-03-16', ''),
(13, NULL, 'Ahorro', '', '', '', '', '', NULL, 'Servicios', 6, 4, 1, 0, 51, 0, 0, '2018-03-16', ''),
(14, 0, 'Ahorro Permanente', '', '', '<div class=\"page\" style=\"text-align: justify;\" title=\"Page 7\"><strong>Ahorro Permanente:</strong> Se tiene en cuenta para solicitud de cr&eacute;dito, al momento de retirar se podr&aacute; utilizar el 80% una vez cumplido el a&ntilde;o, el otro 20% es la base para poder acceder a nuestro cr&eacute;dito.</div>\r\n<div class=\"page\" style=\"text-align: justify;\" title=\"Page 7\">&nbsp;</div>\r\n<div class=\"page\" style=\"text-align: justify;\" title=\"Page 7\"><strong>Aporte Ordinario:</strong> Suma como cupo para solicitud de cr&eacute;dito, sin embargo, es la reserva en el momento de su retiro como asociado o empleado de la compa&ntilde;&iacute;a ENEL Colombia.</div>', 'rendimiento.png', '', '', 'No Aplica', 1, 3, 0, 13, 14, 0, 0, '2018-03-16', ''),
(15, 0, 'Ahorro Voluntario', '', '', '<div class=\"page\" title=\"Page 7\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><strong>(ES LA CANTIDAD MENSUAL ESTIMADA POR EL ASOCIADO)</strong></p>\r\n<p><strong>Destinaci&oacute;n:</strong> Se tiene en cuenta para cupo de cr&eacute;dito o financiaci&oacute;n de servicios.</p>\r\n<p><strong>Desembolso:</strong> Se reintegra, en su totalidad a solicitud del asociado en el momento que lo desee.</p>\r\n<p><br /> Generar&aacute; un inter&eacute;s efectivo anual equivalente al 4,89% efectiva anual.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'ahorro_voluntario-01.png', '', '', 'No Aplica', 2, 1, 0, 13, 15, 0, 0, '2018-03-16', ''),
(16, 0, 'Ahorro a termino (CDAT)', '', '', '<div class=\"page\" title=\"Page 7\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><strong>(Cantidad mensual m&iacute;nimo 3 S.M.M.L.V &ndash; M&aacute;ximo 15 S.M.M.L.V.)</strong></p>\r\n<p>&nbsp;</p>\r\n<div class=\"page\" title=\"Page 7\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<ul>\r\n<li>Tiempo fijo : m&iacute;nimo 3 meses &ndash; m&aacute;ximo 12 meses.</li>\r\n<li>Se redime hasta la fecha del vencimiento (excepto retiro forzoso.) + rendimiento.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'ahorro_cdat-01.png', '', '', 'No Aplica', 1, 3, 0, 13, 16, 0, 0, '2018-03-16', ''),
(17, 0, 'Ahorro Incentivo', '', '', '<p>CODENSA &ndash; EMGESA realizar&aacute; un (1) aporte anual en el mes de diciembre de cada a&ntilde;o de vigencia de la convenci&oacute;n correspondiente:</p>\r\n<p style=\"text-align: center;\"><strong>El 8% para EMGESA - 6% para CODENSA</strong></p>\r\n<p>El cual ser&aacute; girado por la empresa a los Fondos de Empleados. F&oacute;rmula para ingreso al beneficio:</p>\r\n<p style=\"text-align: center;\"><strong>Estar afiliado a FENDESA</strong></p>\r\n<p style=\"text-align: center;\"><strong>Salario * EMGESA % = Total</strong></p>\r\n<p style=\"text-align: center;\"><strong>Salario * CODENSA% = Total</strong></p>\r\n<p>El total podr&aacute; ser diferido hasta 11 meses, para que el asociado pueda realizarlo sin incremento excesivos en la capacidad de endeudamiento.</p>', 'ahorro_incentivo-01.png', '', '', 'No Aplica', 2, 1, 0, 13, 17, 0, 0, '2018-03-16', ''),
(19, 0, 'Cr&eacute;dito', '', '', '', '', '', '', 'Servicios', 1, 3, 1, 0, 46, 0, 0, '2018-03-16', ''),
(20, 0, 'Cr&eacute;dito Social (CS)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Destinado para los gastos de salud, funerarios, calamidad domestica e impuestos (predial, veh&iacute;culo, valorizaci&oacute;n).</p>\r\n<p>&nbsp;</p>\r\n<p>Se otorgar&aacute;n cr&eacute;ditos hasta por el 100% sin superar 25 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_social-01.png', '', '', 'No Aplica', 5, 5, 0, 19, 20, 0, 0, '2018-03-16', ''),
(21, 0, 'Cr&eacute;dito Educativo (CE)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Destinado para el pago de matr&iacute;culas, pensiones de colegios, gastos educativos entre otros.</p>\r\n<p>Se otorgar&aacute;n cr&eacute;ditos hasta por el 100% sin superar 20 SMMLV sin llegar a superar 6 veces la suma de los aportes sociales y el ahorro permanente m&aacute;s 2 veces los ahorros voluntarios.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_educativo-01.png', '', '', 'No Aplica', 4, 1, 0, 19, 21, 0, 0, '2018-03-16', ''),
(22, 0, 'Cr&eacute;dito para Veh&iacute;culo (CVH)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Destinado para la compra o permuta de veh&iacute;culo abonar o cancelar deudas originadas en la compra de veh&iacute;culo.</p>\r\n<p style=\"text-align: justify;\">Se otorgar&aacute;n cr&eacute;ditos hasta por 10 veces la suma de los aportes sociales y el ahorro permanente, m&aacute;s 3 veces los ahorros voluntarios SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_vehiculo.png', '', '', 'No Aplica', 4, 1, 0, 19, 23, 0, 0, '2018-03-16', ''),
(23, 0, 'Cr&eacute;dito de Vivienda (CVV)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<ul>\r\n<li>Destinado para la compra de inmuebles, construcci&oacute;n de vivienda.<br /><br /></li>\r\n<li>Se podr&aacute;n otorgar cr&eacute;ditos hasta por 20 veces la suma de los aportes sociales y el ahorro permanente, m&aacute;s (5) veces los ahorros voluntarios, sin que dicho monto sea inferior a 10 SMMLV ni superior a 250 SMMLV.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_vivienda-01.png', '', '', 'No Aplica', 5, 5, 0, 19, 22, 0, 0, '2018-03-16', ''),
(24, 0, 'Cr&eacute;dito Multiprop&oacute;sito (CM)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Cuya destinaci&oacute;n quedar&aacute; voluntad del asociado.</p>\r\n<p style=\"text-align: justify;\">Se otorgar&aacute;n cr&eacute;ditos (7) veces la suma de los aportes sociales y el ahorro permanente m&aacute;s (2) veces la suma de los ahorros voluntarios sin exceder 70 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_multiproposito-01.png', '', '', 'No Aplica', 5, 5, 0, 19, 24, 0, 0, '2018-03-16', ''),
(25, 0, 'Cr&eacute;dito Credif&aacute;cil (CF)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Cuya destinaci&oacute;n quedar&aacute; a voluntad del asociado.</p>\r\n<p>Se otorgar&aacute;n cr&eacute;ditos (6) veces la suma de los aportes sociales y el ahorro permanente m&aacute;s (2) veces la suma de los ahorros voluntarios sin exceder 4 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credifacil-01.png', '', '', 'No Aplica', 4, 1, 0, 19, 25, 0, 0, '2018-03-16', ''),
(26, 0, 'Cr&eacute;dito Financiaci&oacute;n de Servicios FENDESA (CFS)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Destinado para el pago de los diferentes servicios ofrecidos por FENDESA.</p>\r\n<p style=\"text-align: justify;\">Se otorgar&aacute;n cr&eacute;ditos hasta por 10 veces la suma de los aportes sociales y el ahorro permanente, m&aacute;s 3 veces los ahorros voluntarios sin superar 10 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_fendesa-01.png', '', '', 'No Aplica', 5, 5, 0, 19, 26, 0, 0, '2018-03-16', ''),
(27, 0, 'Cr&eacute;dito Compra de Cartera (CCC)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Cuya destinaci&oacute;n especifica compra de cartera de otros fondos, cooperativas, bancos y entidades financieras.</p>\r\n<p style=\"text-align: justify;\">Se otorgar&aacute;n cr&eacute;ditos (8) veces la suma de los aportes sociales y el ahorro permanente m&aacute;s (3) veces la suma de los ahorros voluntarios sin exceder 70 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_compra_de_cartera-01.png', '', '', 'No Aplica', 4, 1, 0, 19, 27, 0, 0, '2018-03-16', ''),
(28, 0, 'Cr&eacute;dito Credif&aacute;cil Cuota &Uacute;nica (CFU)', '', '', '<div class=\"page\" title=\"Page 8\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Cuya destinaci&oacute;n quedar&aacute; a voluntad del asociado y no esta sujeta a evaluaci&oacute;n de capacidad.</p>\r\n<p style=\"text-align: justify;\">Se otorgar&aacute;n cr&eacute;ditos hasta por el 50% del salario b&aacute;sico mensual devengado por el asociado sin exceder 10 SMMLV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'credito_cuota_unica-01.png', '', '', 'No Aplica', 5, 5, 0, 19, 28, 0, 0, '2018-03-16', ''),
(29, NULL, 'Con&oacute;celos', '', '', '', '', '', NULL, 'Introduccion Equipo', 6, 6, 0, 0, 47, 0, 0, '2018-03-16', ''),
(30, 0, 'SELENA &Aacute;LVAREZ LAGOS', 'Gerente', '', '<div class=\"page\" title=\"Page 11\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Lidero equipo de trabajo integro, comprometido, flexible y altamente calificado para apoyar, guiar, atender y asesorar a los asociados en busca de mejorar su calidad de vida y la de su familia.</p>\r\n<p style=\"text-align: justify;\">M&aacute;s all&aacute; de administrar el fondo, busco su mejoramiento continuo, tanto organizacional, t&eacute;cnico, comercial y financiero.&nbsp; Garantizando el cumplimiento de las normas, reglamentos, pol&iacute;ticas e instructivos internos y los establecidos por las entidades de regulaci&oacute;n y control.</p>\r\n<p style=\"text-align: justify;\">Mis pasiones: Mi familia, mi trabajo, bailar y conocer nuevos lugares en el mundo.</p>\r\n<p style=\"text-align: justify;\"><strong><img src=\"/upload/CORREO.png\" alt=\"CORREO\" width=\"14\" height=\"10\" />&nbsp; gerencia@fendesa.com&nbsp;</strong><strong>&nbsp;<img src=\"/upload/TELEFONO.png\" alt=\"TELEFONO\" width=\"14\" height=\"14\" />&nbsp;704 40 52 &ndash; 704 4113 &nbsp;&nbsp;<img src=\"/upload/IMAGES/WHATSAPPLOGO.png\" alt=\"WHATSAPPLOGO\" width=\"20\" height=\"20\" />&nbsp;+57 318 5920997</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'gerente2-01.png', '', '', 'Equipo', 1, 3, 0, 0, 48, 0, 0, '2018-03-16', ''),
(31, 0, 'NORIDA BARRIOS MORALES', 'Atenci&oacute;n Administrativa', '', '<div class=\"page\" title=\"Page 11\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Fortalezco y blindo el proceso administrativo, organizando y procesando toda la informaci&oacute;n de los asociados y aliados; aplicando las normas t&eacute;cnicas de archivo, sarlaft, protecci&oacute;n de datos acordes a la legislaci&oacute;n vigente, lo anterior, facilitando el servicio a los clientes internos y externos. Fortaleciendo las interacciones de acuerdo con las pol&iacute;ticas y estrategias de servicio, de la mano de tecnolog&iacute;as de informaci&oacute;n y comunicaci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Mis pasiones: Mi familia, Mi carrera, y viajar.</p>\r\n<p><strong><img src=\"/upload/CORREO.png\" alt=\"CORREO\" />Auxiliar01@fendesa.com&nbsp;<img src=\"/upload/TELEFONO.png\" alt=\"TELEFONO\" />704 40 52 &ndash; 704 41 13</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'norida-01.png', '', '', 'Equipo', 2, 3, 0, 0, 53, 0, 0, '2018-03-16', ''),
(32, 0, 'NELLY RODR&Iacute;GUEZ NU&Ntilde;EZ', 'Atenci&oacute;n al Asociado', '', '<div class=\"page\" title=\"Page 11\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">Mi rol me permite conocer y apoyar a los asociados en sus tr&aacute;mites, solicitudes y necesidades en las que le fondo pueda apoyarlos, mi experiencia me hace contar una fuerte capacidad para asesorar integralmente sobre el portafolio de productos y servicios, con el fin de resolver las necesidades expuestas por los asociados de la mejor manera. Adicionalmente, canalizo los requerimientos de los asociados buscando optimizar tiempos y desplazamientos, mejorando la prestaci&oacute;n del servicio.</p>\r\n<p style=\"text-align: justify;\">Mis pasiones: mis hijos, Dios, estudiar, ense&ntilde;ar, colaborar y reir.</p>\r\n<p style=\"text-align: justify;\"><strong><img src=\"/upload/CORREO.png\" alt=\"CORREO\" />Codensa.fendesa@enel.com, servicioalcliente@fendesa.com<br /><br /><img src=\"/upload/TELEFONO.png\" alt=\"TELEFONO\" />601 6060 ext 6057</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'nina_nueva-01.png', '', '', 'Equipo', 2, 3, 0, 0, 49, 0, 0, '2018-03-16', ''),
(33, 0, 'CAROLINA CARRE&Ntilde;O LARGO', 'Atenci&oacute;n en Cartera y Cr&eacute;dito', '<div class=\"page\" title=\"Page 11\">&nbsp;</div>', '<p style=\"text-align: justify;\">Mi rol me permite apoyar, conocer y evolucionar, los modelos financieros de los cr&eacute;ditos y la cartera de nuestros asociados y por ende del fondo, a trav&eacute;s de la generaci&oacute;n y an&aacute;lisis de la informaci&oacute;n. Adicionalmente, gestiono el desarrollo de acciones de cobranza y cr&eacute;dito que me permiten minimizar el riesgo crediticio tanto interno como externo, porque el futuro est&aacute; en nuestra gente y nuestros asociados.</p>\r\n<p style=\"text-align: justify;\">Mis pasiones: Mi hijo, mi madre, mi carrera y viajar.</p>\r\n<p><strong><img src=\"/upload/CORREO.png\" alt=\"CORREO\" />Auxiliar02@fendesa.com&nbsp;<img src=\"/upload/TELEFONO.png\" alt=\"TELEFONO\" />704 40 52 &ndash; 704 41 13</strong></p>', 'corolina-01.png', '', '', 'Equipo', 1, 3, 0, 0, 50, 0, 0, '2018-03-16', ''),
