(1, 1, 'Sanitas', '<div class=\"page\" title=\"Page 9\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><strong>CONTACTO:</strong> <br />ERIKA JEANNETH CORTES PADILLA<br />Asesora Comercial<br />3214697066 -4784435<br />a.medifam@yahoo.com</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'colsanitas-2.png', 1),
(2, 1, 'EMI', '<h3 dir=\"auto\">EMI ahora para los residentes de CHIA,COTA Y CAJICA, en las zonas urbanas y residenciales.</h3>\r\n<div dir=\"auto\"><strong>NORA ZEA<br /></strong><strong>Asesora Comercial</strong><br /><strong>Celular:</strong> 311 8495769</div>', 'emi_logo.png', 2),
(3, 1, 'Coodontologos', '<p style=\"font-weight: 400;\"><strong>Para mayor informaci&oacute;n consulta con un asesor:</strong></p>\r\n<p style=\"font-weight: 400;\"><strong>Marisella Franco P.</strong></p>\r\n<p style=\"font-weight: 400;\">Ejecutiva De Cuenta&nbsp;</p>\r\n<p style=\"font-weight: 400;\">PBX: (1) 340 5590 Ext. 322&nbsp; &nbsp;&ndash; Cel. 3115081028</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p>&nbsp;</p>', 'logo_coodontologos.png', 3),
(4, 2, 'Seguros Ita&uacute;', '<p style=\"font-weight: 400;\"><strong>Ivonne Duarte C.<br /></strong>Gerencia Comercial<br />Brinda asesor&iacute;a en seguros Ita&uacute;, suramericana, seguros bol&iacute;var y solidaria.<br />Telefono:&nbsp;<a href=\"tel:(571)%20339-4750\">(571) 3394750 ext. 4752</a>&nbsp;-&nbsp; M&oacute;vil&nbsp;<a href=\"tel:(312)%20455-4112\">3124554112<br /></a><a href=\"mailto:Ivonne.duarte@itau.co\">Ivonne.duarte@itau.co<br /></a><strong>Ita&uacute;</strong>&nbsp;<strong>Corredor de Seguros<br /></strong>Carrera 7 -27-18 Piso 16<br />Bogot&aacute; - Colombia</p>', 'descarga.png', 4),
(5, 3, 'Movistar', '<h3 style=\"font-weight: 400;\"><a href=\"/upload/IMAGES/TABLA%20MOVISTAR%202019%2002-07-19_TABLAPRECIOS.jpg\" target=\"_blank\">&nbsp;Conoce Nuestros Nuevos Beneficios aqu&iacute;</a></h3>\r\n<p style=\"font-weight: 400;\">Para mayor informaci&oacute;n consulta con un asesor:</p>\r\n<p style=\"font-weight: 400;\"><strong>ATENCI&Oacute;N D&Iacute;AS MARTES SEDE CALLE 98 No 15- 17 OFICINA 509</strong></p>\r\n<p style=\"font-weight: 400;\">Nombre: Olga Lucia Leguizamon Cupitra</p>\r\n<p style=\"font-weight: 400;\">Correo:&nbsp;<a href=\"mailto:olleguizamon@oesia.com\">olleguizamon@oesia.com</a></p>\r\n<p style=\"font-weight: 400;\">Tel&eacute;fono Movil: 3187073555</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>', 'movistar-2.jpg', 5),
(6, 5, 'Cine Colombia', '<p style=\"font-weight: 400;\"><strong>CINE COLOMBIA</strong></p>\r\n<p style=\"font-weight: 400;\">Compra de boleter&iacute;a</p>\r\n<ul>\r\n<li>2D $7.800</li>\r\n<li>3D $12.000</li>\r\n<li>Combos de comida $12.900 (crispetas peque&ntilde;a, gaseosa peque&ntilde;a, perro caliente).</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'cine_colombia_logo.png', 6),
(7, 5, 'DiverCity', '<p style=\"font-weight: 400;\"><strong>Incluye:</strong>&nbsp; &nbsp;</p>\r\n<p style=\"font-weight: 400;\">Supercombo:</p>\r\n<p style=\"font-weight: 400;\">Ingreso de un ni&ntilde;o entre los 3 y 13 a&ntilde;os&nbsp;</p>\r\n<p style=\"font-weight: 400;\">regalos adicionales un pasaporte de ingreso a Divercity, m&aacute;s el 20% de descuentos en fiestas infantiles.</p>\r\n<p style=\"font-weight: 400;\">Financia tu divercity con pizza o divercity con perro caliente.&nbsp;</p>', 'convenios_recreacion_2.png', 7),
(8, 5, 'Teatro Nacional', '<p style=\"font-weight: 400;\"><strong>&iexcl;FENDESA FINANCIA SU&nbsp;BOLETER&Iacute;A!</strong></p>\r\n<p style=\"font-weight: 400;\">Se otorga el 20% de descuento&nbsp;</p>\r\n<p style=\"font-weight: 400;\">Valor total&nbsp;<strong>$36.000</strong></p>', 'logo_teatronacional.jpg', 8),
(9, 5, 'Salitre M&aacute;gico', '<h4><strong>PASAPORTE&nbsp; EXTREMO</strong></h4>\r\n<p style=\"font-weight: 400;\"><strong>Incluye:</strong> Pasaporte con 26 atracciones ilimitadas:</p>\r\n<p style=\"font-weight: 400;\">ïƒ˜ super shot ilimitada.<br />ïƒ˜ Incluye el ingreso al parque. <br />ïƒ˜ Incluye nueva atracci&oacute;n SPLASH. <br />ïƒ˜ Una (1) entrada a Castillo del Terror. <br />ïƒ˜ Una (1) entrada a Carros Chocones.<br />ïƒ˜ Un (1) Juego de destrezas <br /><strong>ïƒ˜ NO INCLUYE: KARTS.</strong></p>\r\n<p style=\"font-weight: 400;\"><strong>VALOR TOTAL A FINANCIAR&nbsp;</strong><strong>A&nbsp;TRAV&Eacute;S&nbsp;DE FENDESA $41.000</strong></p>', 'logo_salitremagico.png', 9),
(10, 5, 'Mundo Aventura', '<p><strong>VALOR TOTAL A FINANCIAR&nbsp;</strong><strong>A&nbsp;TRAV&Eacute;S&nbsp;DE FENDESA &nbsp;$31.000</strong></p>\r\n<ul style=\"font-weight: 400;\">\r\n<li>PASAPORTES SILVER + COMBO MUNDO AVENTURA &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</li>\r\n</ul>', 'logo_mundoaventura.png', 10),
(11, 6, 'UNITEC', '<h1>&nbsp;</h1>\r\n<h3 style=\"font-weight: 400;\">&iexcl;EDUCACI&Oacute;N CORPORACI&Oacute;N UNIVERSITARIA!</h3>\r\n<p style=\"font-weight: 400;\">Para mayor informaci&oacute;n consulta con un asesor:</p>\r\n<p style=\"font-weight: 400;\"><strong>JOHN RODRIGUEZ<br />ASESOR EDUCATIVO<br /></strong><strong>T&Eacute;LEFONO:</strong>&nbsp;743 43 43&nbsp;<strong>&nbsp;EXT</strong>&nbsp;8103<br /><strong>CELULAR:&nbsp;&nbsp;&nbsp;</strong>&nbsp;314 340 53 45</p>', 'logo_unitec.png', 11),
(12, 7, 'CasaToro', '<p>Te presentamos el convenio CasaToro Ford - Fendensa para que puedas estrenar un Ford a un precio exclusivo.</p>\r\n<p>Pide ahora mismo asesor&iacute;a con</p>\r\n<p><strong>Lupe Monroy Fern&aacute;ndez&nbsp;&nbsp;</strong></p>\r\n<p>Cel:&nbsp;315 8516309<br />Tel:&nbsp;611 7000 ext 121<br />Bogot&aacute;: Carrera 15 No. 97 - 49 |&nbsp;PBX (1) 611 7000</p>\r\n<p>Registra tu Ford en&nbsp;registresuford.com<br /><a href=\"http://www.casatoro.com\">www.casatoro.com</a></p>', 'logo_casatoro.png', 12),
(19, 4, 'Grupo Recordar', '<p><strong>Diana Marcela Ram&iacute;rez</strong><strong><br /></strong>Ejecutivo de negocios corporativos<br /><strong>Cel: 313 3972554&nbsp;</strong></p>', 'captura_de_pantalla_2018-03-21_a_las_71715_pm.png', 19),
(20, 8, 'Viajes Festival Tours', '<p><strong>DIANA GU&Aacute;QUETA GUZMAN<br />Ejecutiva de Cuenta<br /></strong></p>\r\n<p>Bogot&aacute; - Colombia<br />Cra 13 # 40a - 25<br />Tel&eacute;fono: (57-1) 2880037 Ext. 115<br />www.festivaltours.co</p>', 'captura_de_pantalla_2018-03-21_a_las_72118_pm.png', 20),
(14, 5, 'Parque Jaime Duque', '<p>&nbsp;</p>\r\n<p>Brazalete general : <strong>$27.200</strong>&nbsp;</p>\r\n<p>No cubre:&nbsp;</p>\r\n<ul>\r\n<li>Carros chocones</li>\r\n<li>Tren de troncos bioparque</li>\r\n<li>Tren panor&aacute;mico&nbsp;</li>\r\n<li>Tren terrestre al Bioparque</li>\r\n<li>Chiqui rodeo-ponys</li>\r\n</ul>', 'parque-jaime-duque-1-638.jpg', 14),
(15, 6, 'CANADIAN COLLEGE', '<p><strong>Ingresa 2x1*</strong></p>\r\n<p>Este <strong>desequilibrio</strong> t&uacute; tambi&eacute;n lo superar&aacute;s <strong>inclin&aacute;ndote</strong> por nosotros incl&iacute;nate s&oacute;lo por <strong>ingl&eacute;s</strong> o <strong>Franc&eacute;s&nbsp;</strong></p>\r\n<ul>\r\n<li>Metodolog&iacute;a&nbsp;</li>\r\n<li>Multidimensional</li>\r\n<li>Integrada</li>\r\n</ul>\r\n<p><strong>Cristian Bernal</strong><br /><strong>Asesor en Biling&uuml;ismo</strong><br /><strong>Celular:</strong> (57) 310 287 1275<br /><strong>Pbx:</strong> (571) 617 1414<br /><strong>Correo:</strong>cbernal@canadiancollege.edu.co<br /><strong>Unal:</strong> Calle 45 N&deg; 27&ordf;-41<br /><strong>Iserra:</strong> Calle 100 N&deg; 60-93<br /><strong>Castellana:</strong> Cra 45&ordf; N&deg; 95-80<br />Bogot&aacute; - Colombia - Suram&eacute;rica<br /><strong>www.canadiancollege.edu.co</strong></p>\r\n<p>&nbsp;</p>', 'logo-canadiancollege-nuevo-548x134.png', 15),
(16, 5, 'Cinemark', '<p>&nbsp;</p>\r\n<p><strong>Compra de boletas</strong></p>\r\n<p>2D + COMBO Combos de comida (crispeta peque&ntilde;a, gaseosa peque&ntilde;a, perro caliente) (<strong>$27,200</strong>)</p>', 'captura_de_pantalla_2018-03-21_a_las_64452_pm.png', 16),
(17, 5, 'Playland', '<p>DESCRIPCI&Oacute;N TARJETA MAGENTA</p>\r\n<p>Tarjeta de tiempo 2 horas que incluye grandes atracciones,<br />equipos infantiles, zona de videos y simuladores + COMBO<br />Crispeta de sal+gaseosa pet 400 ml o caja de jugo x 200ml&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PRECIO : $23.000</strong></p>\r\n<p>*<strong>No aplica para juegos de tickets &ndash; gr&uacute;as -&nbsp; Playlandsoft &ndash; Playlandkids</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'captura_de_pantalla_2018-03-21_a_las_65133_pm.png', 17),
(18, 6, 'UNIHORIZONTE', '<p><strong>Contacto:</strong></p>\r\n<p><strong>Yohan Fabian Cancelado.<br /></strong>Gestor Comercial<br />Tel.:&nbsp;(57-1) 743 7270 Ext.: 140<br />comercial@unihorizonte.edu.co<br />Cll. 69 No. 14 - 30<br />Bogot&aacute; Colombia<br />www.unihorizonte.edu.co</p>', 'captura_de_pantalla_2018-03-21_a_las_65957_pm.png', 18),
(21, 8, 'Expreso Viajes y Turismo Agencia de Viajes Cafam', '<p>5% De descuento en porciones terrestres en la primera<br />compra.</p>\r\n<p>3% En porci&oacute;n terrestre Nacional</p>\r\n<p>2% En internacional</p>\r\n<p><strong>DULL CARDOZO ROMERO</strong><br />Asesor Vacacional Central De Servicios Bavaria<br />Expreso Viajes y Turismo Agencia de Viajes Cafam<br />Cra 13 No. 29-17 Bogota, Colombia<br />Ph: +571 7432666 Ext 640<br />Email: Dcardozo@Expresoviajes.Com<br />Celular 3187075428</p>', 'captura_de_pantalla_2018-03-21_a_las_72307_pm.png', 21),
(22, 8, 'Comfacundi', '<p><strong>LEONARDO LONDO&Ntilde;O&nbsp; &nbsp;</strong><br /><strong>DIRECTOR EJECUTIVO<br /></strong>M&oacute;viles&nbsp;[300] 570 2960 -&nbsp;[301] 758 4099<br />ORGANIZACI&Oacute;N&nbsp;SK@PATE&nbsp;S.A.S<br />Especialistas en&nbsp;Turismo y Eventos.<br />RNT.&nbsp;30502</p>', 'captura_de_pantalla_2018-03-21_a_las_73126_pm.png', 22),
(23, 9, 'Sante et Vie Spa', '<p>Punto de Financiaci&oacute;n<br /><br />ENYELBERT ALEXANDER APARCIO&nbsp;<br /><strong>Atenci&oacute;n al asociado<br /></strong>Carrera 13&ordf; 93-66 piso 1<br />Tel&eacute;fono: 6016060 ext. 6057</p>', 'captura_de_pantalla_2018-03-21_a_las_73800_pm.png', 23),
(24, 9, 'Novast&eacute;tica', '<p><strong>Nelfi Vargas</strong><br /> Gerente General<br /> Novastetica&nbsp;<a href=\"http://s.as/\">S.AS</a><br /> Cel. 3118463454 - 3227466&nbsp;<br /> Calle118#15a-14 Piso 2</p>', 'captura_de_pantalla_2018-03-21_a_las_73914_pm.png', 24),
(25, 10, 'Creativo F.C.', '<p><strong>Academia de Futbol</strong><br /><strong>Alquiler de canchas de futbol</strong></p>\r\n<p><strong>CONTACTO:<br /></strong>MIGUEL BONILLA&nbsp;&nbsp;<br />MANUEL MILLAN<br />345 6261 654</p>', 'captura_de_pantalla_2018-03-21_a_las_74110_pm.png', 25),
(26, 11, 'epk', '<h3 style=\"font-weight: 400;\">&nbsp;</h3>\r\n<p style=\"font-weight: 400;\"><strong>IMPORTANTE:</strong></p>\r\n<p>Identificarse en la caja con el nombre del convenio al cual pertenecen, seguido con su CEDULA DE CIUDADANIA para que puedan sobre el valor aplicar el descuento del convenio.</p>\r\n<p>El descuento aplica en la caja para el pago, de igual manera aplica si manejan convenio con cr&eacute;dito, en caso de que sea cr&eacute;dito deben presentar su orden de servicio diligenciada por el Fondo Empleados.&nbsp;</p>', 'captura_de_pantalla_2018-03-21_a_las_74551_pm.png', 26);
